import React, { useEffect } from 'react'
import { useHistory } from 'react-router-dom'
import { Switch, Route } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'

import HostProfile from './HostProfile'
import HostEditProfile from './HostEditProfile'
import MenuHost from './HostMenu'
import AddApartment from './HostAddApartment'
import HostReservations from './HostReservations'
import HostServices from './HostServices'
import ColivingManager from '../ColivingManager'
import Footer from '../Footer'
import Coliving from '../Coliving'

const HostDashboard = () => {
    const dispatch = useDispatch()
    const user = useSelector(s => s.user)
    const coliving = useSelector(s => s.coliving)
    const login = (user) => dispatch({ type: 'login', user })
    const history = useHistory()

    const isLoggedIn = useSelector(s => !!s.user)
    useEffect(() => {
        if (!isLoggedIn) {
            history.push(`/host`)
        }
    }, [isLoggedIn])

    if (!user) return 'Loading...'

    return (
        <>
            <p> {coliving.contact_name} bienvenid@ al panel de gesti√≥n de tu {coliving.name} </p>
            <div className="private-hosts">
                <MenuHost />
                <main>
                    <Switch>
                        <Route path="/host" exact>
                            <ColivingManager />
                            <Footer />
                        </Route>
                        <Route path="host/profile" >
                            <HostProfile />
                        </Route>
                        <Route path="host/profile/edit" >
                            {/*<HostEditProfile />*/}
                        </Route>
                        <Route path="host/add/apartment" >
                            {/*<AddApartament />*/}
                        </Route>
                        <Route path="host/services" >
                            {/*<HostServices />*/}
                        </Route>
                        <Route path="host/reservations" >
                            {/*<HostReservations />*/}
                        </Route>
                    </Switch>
                </main>
            </div>
        </>
    )
}

export default HostDashboard
